import React from 'react';
import styled from 'styled-components';

// Import profile images dynamically
const importProfileImage = (name) => {
  try {
    // Remove spaces and special characters for file name matching
    const fileName = name.replace(/\s+/g, '').replace(/[^\w\s]/gi, '');
    return require(`../assets/images/${fileName}.jpg`);
  } catch (error) {
    // Return null if image doesn't exist
    return null;
  }
};

const TeamPage = () => {
  const departments = [
    { id: 'leadership', name: 'Leadership', color: '#c9b8a8' },
    { id: 'events', name: 'Events', color: '#c9b8a8' },
    { id: 'operations', name: 'Ops & Logistics', color: '#c9b8a8' },
    { id: 'media', name: 'Media & Marketing', color: '#c9b8a8' },
    { id: 'content', name: 'Content', color: '#c9b8a8' },
    { id: 'design', name: 'Design', color: '#c9b8a8' },
    { id: 'external', name: 'External Relations', color: '#c9b8a8' },
    { id: 'photography', name: 'Photography', color: '#c9b8a8' },
    { id: 'tech', name: 'Tech', color: '#c9b8a8' }
  ];

  const teamMembers = {
    leadership: [
      { id: 'president', name: 'Harish Prabu', role: 'President' },
      { id: 'vp', name: 'Ojaskrisshnan', role: 'Vice President' },
      { id: 'director', name: 'Shreem Seth', role: 'Director' }
    ],
    operations: [
      { id: 'op1', name: 'Muhammed Sheik', role: 'Head' },
      { id: 'op2', name: 'Tanvi Shree', role: 'Head' },
      { id: 'op3', name: 'Yuvan Kumar', role: 'Jr Head' },
      { id: 'op4', name: 'Pritika R.D', role: 'Jr Head' }
    ],
    content: [
      { id: 'content1', name: 'Guruparan', role: 'Head' },
      { id: 'content2', name: 'Maansi', role: 'Head' },
      { id: 'content3', name: 'Anbini K', role: 'Jr Head' }
    ],
    external: [
      { id: 'external1', name: 'Samyuktha Venkatasamy', role: 'Head' },
      { id: 'external2', name: 'Oliver Lourdino Mahinthan', role: 'Head' }
